import Navbar from "./Navbar";
import Search from "./Search";

const Header = () => (
  <div className="container-fluid header">
    <div className="row">
      Header
      <Navbar/>
      <Search/>
    </div>

    <style jsx>{`
      .header {
        background-color: rgb(255, 255, 255);
      }
    `}</style>
  </div>
);

export default Header;
